    plt.Kernel.toWrittenString = function(x) {
	if (x == undefined || x == null) {
	    return "<undefined>";
	}
	if (typeof(x) == 'string') {
	    return x.toWrittenString();
	}
	if (typeof(x) != 'object' && typeof(x) != 'function') {
	    return x.toString();
	}
	if ('toWrittenString' in x) {
	    return x.toWrittenString();
	}
	if ('toDisplayedString' in x) {
	    return x.toDisplayedString();
	} else {
	    return x.toString();
	}
    };


